import React from 'react';

// Example projects data
const PROJECTS = [
  {
    title: "Inventory Management System",
    description: "A full-featured inventory management app with real-time updates and analytics.",
    tech: ["React", "Node.js", "MongoDB", "Socket.io"],
    image: "/assets/projects/inventory.png",
    link: "#"
  },
  {
    title: "Secure Chat App",
    description: "Real-time chat application with end-to-end encryption and group chat support.",
    tech: ["React Native", "Express.js", "Socket.io"],
    image: "/assets/projects/chat.png",
    link: "#"
  },
  {
    title: "Portfolio Website",
    description: "Personal portfolio showcasing skills, projects, and contact information.",
    tech: ["React", "Figma", "CSS"],
    image: "/assets/projects/portfolio.png",
    link: "#"
  }
];

export default function Projects() {
  return (
    <section id="projects" className="projects-section">
      <div className="projects-header">
        <h2>Projects</h2>
        <span className="muted">Some of my recent work</span>
      </div>
      <div className="projects-grid">
        {PROJECTS.map(project => (
          <div className="project-card-modern" key={project.title}>
            <div className="project-image-wrap">
              <img src={project.image} alt={project.title} className="project-image" />
            </div>
            <div className="project-info">
              <h3 className="project-title">{project.title}</h3>
              <p className="project-desc">{project.description}</p>
              <div className="project-tech-list">
                {project.tech.map(tech => (
                  <span className="project-tech" key={tech}>{tech}</span>
                ))}
              </div>
              <a href={project.link} className="project-link" target="_blank" rel="noopener noreferrer">
                View Project
              </a>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
}
